def rewards_to_bin_mean(rewards, bin_size=5):
	all_rewards = []
	current_block = []
	for i in range(0, len(rewards), bin_size):
		bin_mean = np.mean(rewards[i: i + bin_size])
		all_rewards.append(bin_mean)
	return all_rewards
